import React from "react";
import { Link } from "react-router-dom";

const Desc = () => {
  return (
  <section className="page-section clearfix">
    <div class="container">
      <div class="intro">
        <img class="intro-img img-fluid mb-3 mb-lg-0" src="../lab.jpg" alt=""/>
        <div class="intro-text left-0 text-center bg-faded p-5 about">
          <h2 class="section-heading mb-4">
            <span>What we do</span>
          </h2>
          <p class="mb-3">We host and promote many events such as panel discussions from companies, chill nights, mentorship programs, career talks and many more opportunities for networking.
          </p>
        </div>
      </div>
    </div>
  </section>
  );
};

export default Desc;
